We introduce a custom_details field that uses a provider name as key to an object with the bespoke values to that provider. Example: { "suggestions": [ { ... "provider": "addons", "custom_details": { "addons": { "rating": "4.7459" } } }, ... ], ...
} The specific fields in custom_details will all be optional (i.e. addons will be an optional key) but the shape of what goes in addons can be more strict (i.e. addons require a rating field). A partial schema specification for the above might look like [1] : { "$schema": "https://json-schema.org/draft/2020-12/schema", "title": "Suggest API Response v1", "description": "Response for /api/v1/suggest", "type": "object", "properties": { "provider": { "description": "id for the provider type", "type": "string" }, "custom_details": { "type": "object", "properties": { "addons": { "type": "object", "description": "Custom Addon Fields", "properties": { "rating": { "type": "number" } }, "required": ["rating"] } } } }, "required": ["provider"]
} Can play with JSON schema in https://www.jsonschemavalidator.net/ Pros Can specify specific validation per provider. Clear ownership of rating to addons via structure. Fields outside of custom_details can be fields that are more universal across suggestions. These fields can potentially be correlated directly to the Fx Suggest Design Framework (i.e. context_label, url, title, description, etc.). Having a clear distinction for Fx Suggest Design Framework fields vs. bespoke fields makes this more backwards compatible, as the fields in the Design Framework can render the default suggestion case for clients who haven't upgraded their clients. Cons We'll likely need to migrate existing providers at some point. But in the meantime, some fields will not follow convention to maintain backwards compatibility. Extra nesting inside of custom_details.

