def test_with_provider() -> None: pass SetupProvidersFixture This fixture sets application provider dependency overrides. Usage: def test_with_setup_providers(setup_providers: SetupProvidersFixture): providers: dict[str, BaseProvider] = {"test-provider": TestProvider()} setup_providers(providers) TeardownProvidersFixture This fixture resets application provider dependency overrides and is often used in teardown fixtures. Usage: @pytest.fixture(autouse=True)
def teardown(teardown_providers: TeardownProvidersFixture): yield teardown_providers()

